import React from 'react';

export default ({ title, children }) => {
  return (
    <div className='border-b border-gray-300 pt-2 pb-5'>
      <h3 style={{ fontFamily: 'airbnb-book' }} className='my-4 text-gray-750'>
        {title}
      </h3>
      {children}
    </div>
  );
};
